import axios from 'axios';

export function loadItemsData() {
    return (dispatch: any): any => {
        axios
            .get('http://www.mocky.io/v2/5e982fa93500007f00c47f6c')
            .then(function (response) {
                // handle success
                console.log(response);
            })
            .catch(function (error) {
                // handle error
                console.log(error);
            });
    };
}
